import React from 'react';
import Swapi from 'swapi-node';


export class Films extends React.Component {
    doSwapi() {
        Swapi.getPerson(1).then((result) => {
            console.log(result);
        });
    }
    render() {
        doSwapi()
        return (
            <p>turn it up</p>
        );
    }
}
